(function() {
  $(document).ready(function() {
    return $('.js-org-trigger').on('click', function(event) {
      return $('.js-org-target').toggle();
    });
  });

}).call(this);
$(document).ready(() => {

  $('.js-pre-process-application').on('click', preProcess);

  async function deviceCameraExists() {
    try {
      let md = navigator.mediaDevices;
      if (md && md.enumerateDevices){
        const devices = await md.enumerateDevices();
        return devices.some(device => 'videoinput' === device.kind);
      }
    } catch (error) {
      console.log('Error occured during device camera check: ',error);
    }
    return false;
  }

  function preProcess(event) {
    event.preventDefault();

    $('.js-processing-application').prop('hidden', false);

    $('.js-error-processing-application').prop('hidden', true);
    $('.js-error-processing-application').html('Your application is more likely to be quickly reviewed and approved if you address:')
    $('.js-preprocess-button').prop('hidden', true);

    deviceCameraExists().then((deviceWithCamera) => {
      $.ajax(this.href, {
        type: 'GET',
        data: {
          digest: $("#discount_request_attachment_digest").val(),
          attachment_data: $("#discount_request_attachment").val(),
          attachment_proof_type: $("#discount_request_attachment_proof_type").val(),
          device_with_camera: deviceWithCamera
        },
        success: function(data, textStatus, jqXHR) {
          $('.js-error-processing-application').prop('hidden', true);
          $('.final-submit').click();
          $('.js-processing-application').prop('hidden', true);
          $('.js-form-submission-buttons').prop('hidden', false);
        },
        error: function(jqXHR, textStatus, errorThrown) {
          $('.final-submit').prop('value', 'Continue anyway');
          $('.js-processing-application').prop('hidden', true);
          $('.js-form-submission-buttons').prop('hidden', false);

          $('.js-error-processing-application').prop('hidden', false);
          for(var error in jqXHR.responseJSON) {
            $('.js-error-processing-application').append("<ul class='ml-5'><li>" + jqXHR.responseJSON[error] + "</li></ul>");
          }
        }
      });
    });
  }
});
